// src/pages/Portfolio.jsx
import React, { useState } from 'react';
import { FaCode, FaCertificate, FaTools, FaGithub, FaExternalLinkAlt } from 'react-icons/fa';
import realEstateImg from '../assets/real-estate-marketplace.png';
import discordBotImg from '../assets/discord-bot.png';
import './Portfolio.css';

const Portfolio = () => {
  const [activeTab, setActiveTab] = useState('projects');

  const projects = [
    {
      title: 'Real Estate Marketplace',
      description: 'A comprehensive real estate platform featuring ML-powered price validation, fraud detection, and an AI chatbot assistant. The platform streamlines property listing and browsing with automated verification processes, ensuring fair pricing through advanced anomaly detection algorithms.',
      image: realEstateImg,
      technologies: ['MongoDB', 'Express.js', 'React.js', 'Node.js', 'Random Forest', 'Isolation Forest', 'Gemini API', 'JWT', 'AWS S3'],
      github: 'https://github.com/yourusername/real-estate-marketplace',
      demo: 'https://real-estate-marketplace.demo.com',
      featured: true
    },
    {
      title: 'Auto-Chat-Discord',
      description: 'AI-powered Discord bot with smart commands, moderation features, and natural language processing capabilities. Enhances server engagement and automates tasks.',
      image: discordBotImg,
      technologies: ['Node.js', 'Discord.js', 'OpenAI', 'MongoDB'],
      github: 'https://github.com/yourusername/auto-chat-discord',
      demo: 'https://discord.com/api/oauth2/authorize?client_id=your_bot_id',
      featured: true
    }
  ];

  const certificates = [
    {
      title: 'AWS Certified Solutions Architect',
      issuer: 'Amazon Web Services',
      date: 'March 2024',
      credentialId: 'AWS-SAA-123456',
      icon: 'üèÜ'
    },
    {
      title: 'Google Professional Cloud Developer',
      issuer: 'Google Cloud',
      date: 'January 2024',
      credentialId: 'GCP-PCD-789012',
      icon: 'üéØ'
    },
    {
      title: 'Meta Frontend Developer',
      issuer: 'Meta',
      date: 'December 2023',
      credentialId: 'META-FED-345678',
      icon: 'üí´'
    }
  ];

  const skills = [
    { name: 'React.js', icon: '/icons/react-icon.svg', level: 'Advanced' },
    { name: 'Node.js', icon: '/icons/node-icon.svg', level: 'Advanced' },
    { name: 'Python', icon: '/icons/python-icon.svg', level: 'Intermediate' },
    { name: 'MongoDB', icon: '/icons/mongodb-icon.svg', level: 'Advanced' },
    { name: 'Firebase', icon: '/icons/firebase-icon.svg', level: 'Intermediate' },
    { name: 'HTML5', icon: '/icons/html5-icon.svg', level: 'Advanced' },
    { name: 'CSS3', icon: '/icons/css3-icon.svg', level: 'Advanced' },
    { name: 'JavaScript', icon: '/icons/js-icon.svg', level: 'Advanced' }
  ];

  return (
    <section id="portfolio" className="portfolio-section">
      <div className="portfolio-container">
        <div className="portfolio-header">
          <h2 className="portfolio-title">
            Portfolio <span className="highlight">Showcase</span>
          </h2>
          <p className="portfolio-subtitle">
            Explore My Journey through Projects, Certificates, And Technical Expertise. Each Section
            Represents a Milestone in My Continuous Learning Path
          </p>
        </div>

        <div className="portfolio-tabs">
          <button
            className={`tab-button ${activeTab === 'projects' ? 'active' : ''}`}
            onClick={() => setActiveTab('projects')}
          >
            <FaCode /> Projects
          </button>
          <button
            className={`tab-button ${activeTab === 'certificates' ? 'active' : ''}`}
            onClick={() => setActiveTab('certificates')}
          >
            <FaCertificate /> Certificate
          </button>
          <button
            className={`tab-button ${activeTab === 'skills' ? 'active' : ''}`}
            onClick={() => setActiveTab('skills')}
          >
            <FaTools /> My Skill
          </button>
        </div>

        <div className="portfolio-content">
          {activeTab === 'projects' && (
            <>
              {projects.map((project, index) => (
                <div key={index} className={`portfolio-card project-card ${project.featured ? 'featured' : ''}`}>
                  <div className="card-image-container">
                    <img src={project.image} alt={project.title} className="card-image" />
                    {project.featured && <span className="featured-badge">Featured</span>}
                  </div>
                  <div className="card-content">
                    <h3 className="card-title">{project.title}</h3>
                    <p className="card-description">{project.description}</p>
                    <div className="card-technologies">
                      {project.technologies.map((tech, i) => (
                        <span key={i} className="technology-tag">
                          {tech}
                        </span>
                      ))}
                    </div>
                    <div className="card-links">
                      <a href={project.github} target="_blank" rel="noopener noreferrer" className="card-link">
                        <FaGithub /> View Code
                      </a>
                      <a href={project.demo} target="_blank" rel="noopener noreferrer" className="card-link">
                        <FaExternalLinkAlt /> Live Demo
                      </a>
                    </div>
                  </div>
                </div>
              ))}
            </>
          )}

          {activeTab === 'certificates' && (
            <div className="certificates-grid">
              {certificates.map((cert, index) => (
                <div key={index} className="certificate-card">
                  <div className="certificate-content">
                    <span className="certificate-icon">{cert.icon}</span>
                    <h3 className="certificate-title">{cert.title}</h3>
                    <p className="certificate-issuer">{cert.issuer}</p>
                    <p className="certificate-date">{cert.date}</p>
                    <p className="certificate-id">Credential ID: {cert.credentialId}</p>
                  </div>
                </div>
              ))}
            </div>
          )}

          {activeTab === 'skills' && (
            <div className="skills-container">
              <div className="skills-grid">
                {skills.map((skill, index) => (
                  <div key={index} className="skill-item">
                    <img src={skill.icon} alt={skill.name} className="skill-icon" />
                    <span className="skill-name">{skill.name}</span>
                    <span className="skill-level">{skill.level}</span>
                  </div>
                ))}
              </div>
            </div>
          )}
        </div>
      </div>
    </section>
  );
};

export default Portfolio;
